response.about:
Я профессиональный преподаватель английского языка с 10-летним опытом работы в профессиональном языковом центре и репетиторства.  

Я занимаюсь тем, что помогаю взрослым овладеть английским для быстрых целей.

Я вам нужна если:  

- вам требуется качественная языковая подготовка в кратчайшие сроки;  

- вы не представляете, с чего начать и что нужно делать;

- вам нужно подготовить презентацию своей продукции или услуг на английском языке;

- вы не хотите учить много - но хотите восприниматься качественно;

============================  

Что мы с вами сделаем?  

Встретимся и составим персональную программу под вашу цель и с учетом ваших персональных особенностей.  

Уже сейчас вы можете записаться на первую БЕСПЛАТНУЮ консультацию, где мы создадим ваш личный план тренировок. 

Пишите в ЛС.
